import React, { Component } from 'react'

class Main extends Component {
    render() {
        return (
            <div id='content' >
                <table className='text-center'>
                    <tread>
                        <tr style={{ color: 'black' }}>
                            <th scope='col'>Staking Balance</th>
                            <th scope='col'>Reward Balance</th>
                        </tr>
                    </tread>
                  </table>

            </div>

        )
    }
}

export default Main;
